import { useCallback } from 'react';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image } from 'react-native';
import { useFonts } from 'expo-font';
import * as SplashScreen from 'expo-splash-screen';
import { SvgXml } from 'react-native-svg';

SplashScreen.preventAutoHideAsync();

export default function App() {

  const [fontsLoaded] = useFonts ({
    'ABeeZee': require("./assets/fonts/ABeeZee.ttf"),
  });

  const onLayoutRootView = useCallback(async () => {
    if (fontsLoaded) {
      await SplashScreen.hideAsync();
    }
  }, [fontsLoaded]);
  
  if (!fontsLoaded) {
    return null;
  }

  return (
    <View style={styles.container} onLayout={onLayoutRootView}>
      <Text style={styles.welcomeText}>Welcome to</Text>
      <SvgXml style={styles.logo} xml={logoSVG}/>
      {/* <Image
        style = {styles.logo}
        source = {require("./assets/assembly_icon.png")} />
      <StatusBar style="auto" /> */}
      
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    paddingTop: 50,
  },
  welcomeText: {
    fontFamily: 'ABeeZee',
    fontSize: 36,
  },
  logo: {
    marginTop: -10,
    marginRight: 115,
    width: 300,
    height: 225,
  }

});

const logoSVG = `<svg width="390" height="288" viewBox="0 0 390 288" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect x="-61" width="512" height="288" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_351_4" transform="scale(0.00195312 0.00347222)"/>
</pattern>
<image id="image0_351_4" width="512" height="288" xlink:href="data:image/png;base64,"/>
</defs>
</svg>`;